//--page-split-- stars_open_window

void stars_open_window() {

  list = glGenLists(1);

  glNewList(list, GL_COMPILE);

  glDisable(GL_FOG);

  glEnable(GL_BLEND);
  glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);
  glHint(GL_POINT_SMOOTH_HINT, GL_NICEST);
  glEnable(GL_POINT_SMOOTH);

  #define brightness (7 * star[i][3])

  int i;
  int dark = 0;

  glPointSize(1.5);
  glBegin(GL_POINTS);
  for (i = 0; i < star_count && brightness <= 1.0; i++) {
    double gray = pow(brightness, 0.4545);
    glColor3f(gray, gray, gray);
    glVertex3f(star[i][0], star[i][1], star[i][2]);
  };
  glEnd();

  //printf("%d dark stars...\n", dark);

  glColor3f(1.0, 1.0, 1.0);
  for (; i < star_count; i++) {
    glPointSize(sqrt(brightness));
    glBegin(GL_POINTS);
    glVertex3f(star[i][0], star[i][1], star[i][2]);
    glEnd();
  };

  glDisable(GL_POINT_SMOOTH);
  glDisable(GL_BLEND);

  glEndList();

};

//--page-split-- stars_close_window

void stars_close_window() {
  glDeleteLists(list, 1);
};

//--page-split-- stars_render

#define sidereal_seconds 86164.091

void stars_render() {
  glPushMatrix();
  glTranslated(player_view.x, player_view.y, player_view.z);
  glRotated(-90, +1, 0, 0); // Our up is the planet's side!
  glRotated(180, 0, 0, +1); // Our up is the planet's side!
  glRotated(+latitude, -1, 0, 0);
  glRotated(+longitude + fmod(time(NULL), sidereal_seconds) * 360 / sidereal_seconds + fudge, 0, 0, -1);
  glCallList(list);
  glPopMatrix();
};
